import './CollectWallet.css';

const ConnectWallet =() =>{
    return(
    <div class="container text-white">
      <h1>Connect Your Wallet</h1>
      <form>
        <label for="wallet text-white">Wallet Address:</label>
        <input type="text" id="wallet text-white" name="wallet" placeholder="Enter your wallet address" required/>
        <button type="submit">Connect</button>
    </form>

    </div>
    )
}
export default ConnectWallet;
